import React from 'react';
import { Container } from 'react-bootstrap';
import { Link } from 'react-router-dom';

export default function BrandBar() {
  return (
    <div className="brandbar">
      <Container className="brandbar-inner">
        {/* Left placeholder for language or anything */}
        <div className="brandbar-left">
          {/* <span className="muted">English</span> */}
        </div>

        {/* Centered logo */}
        <div className="brandbar-logo">
          <Link to="/">
            <img
              src="/brand/koko-logo.svg"
              alt="KOKO SARANG"
              className="brand-logo-img"
            />
          </Link>
        </div>

        {/* Right icons */}
        <div className="brandbar-icons">
          <Link to="/search" title="Search" className="icon-link">
            <i className="fas fa-search"></i>
          </Link>
          <Link to="/login" title="Account" className="icon-link">
            <i className="fas fa-user"></i>
          </Link>
          <Link to="/wishlist" title="Wishlist" className="icon-link">
            <i className="fas fa-heart"></i>
          </Link>
          <Link to="/cart" title="Cart" className="icon-link">
            <i className="fas fa-shopping-bag"></i>
          </Link>
        </div>
      </Container>
    </div>
  );
}
